import React, { useState } from 'react';
import AddOutlinedIcon from '@material-ui/icons/AddOutlined';
import RemoveOutlinedIcon from '@material-ui/icons/RemoveOutlined';
import AccessTimeOutlinedIcon from '@material-ui/icons/AccessTimeOutlined';
import Button from '@material-ui/core/Button';
import Clock from 'react-clock';



const App = () => {
    <Clock />

    const pastTime = new Date().toLocaleTimeString();


    const [time, setTime] = useState(pastTime);

    const RealTime = () => {
        setTime(pastTime);
    };


    const [count, setCount] = useState(0);

    const IncNum = () => {
        setCount(count + 1);
    };

    const DecNum = () => {
        if (count <= 0) {
            alert("You can't go below zero");
        }
        else {
            setCount(count - 1);

        }

        <Clock />


    };




    return (
        <>

            <h1>{count}</h1>
            <Button
                variant="contained" color="primary" onClick={IncNum}>< AddOutlinedIcon />
            </Button>
            <Button
                variant="contained" color="secondary" onClick={DecNum}><RemoveOutlinedIcon />
            </Button>
            <p>{time}</p>
            <button onClick={RealTime}>< AccessTimeOutlinedIcon /></button>
        </>
    )
}

export default App
